import React from 'react';
import { Routes, Route } from 'react-router-dom';
import EmployeeReg from '../componenets/Employee';
import MainPage from '../componenets/Main';


/* Main layour componenet: */
const MainRoutes = () => {
    return (
        <Routes>
            <Route path='/' element={<MainPage/>}/>
            <Route path='/employeereg' element={<EmployeeReg />} />
            <Route path='/employer' element={<p> Szevasz, ide jon majd a employer reg</p>} />
            <Route path='/contactus' element={<p> Szevasz, ide jon majd contactus</p>} />
        </Routes>
    )
};

export default MainRoutes;
